import React from "react";
 

const Kisi = (prop) => {
  const { isim, img, yas, kurs } = prop;

  return (
    <div className="card">
      <div>
      <h1>{isim}</h1>
      <img src={img} alt="" width={100} />
      <h4>{yas}</h4>
      <h4>{kurs}</h4>
      </div>
    </div>
  );
};

export default Kisi;
